import React from "react";

const Checkout =()=>{

    return <form>
        <label>Name</label>
        <input type='text'></input>
        <label>Street</label>
        <input type='text'></input>
        <label>Postal Code</label>
        <input type='text'></input>
        <label>City</label>
        <input type='text'></input>
        <button>Cancel</button>
        <button>Confirm</button>
    </form>
};

export default Checkout;
